class Simulation():
    def simular(self):
        pygame.init()

        global largura
        global altura
        global planeta_clicado
        global informacoes
        global nome_planeta_usuario
        global massa_planeta_usuario
        global vel_planeta_usuario
        global dist_sol_usuario

        info = False

        WIDTH, HEIGHT = largura - 200, altura - 100
        WIN = pygame.display.set_mode((WIDTH, HEIGHT))
        pygame.display.set_caption("P.S.S. Simulation")

        WHITE = (255, 255, 255)
        YELLOW = (255, 255, 0)
        BLUE = (0, 127, 255)
        SLATEBLUE = (50, 50, 205)
        ICE = (102, 255, 255)
        STRAW = (255, 204, 51)
        COOPER = (217, 135, 25)
        GOLDENROD = (219, 219, 112)
        RED = (204, 0, 0)
        BRICK = (156, 102, 31)
        PURPLE = (132,36,132)

        FONT = pygame.font.SysFont("comicsans", 16)

        class Planet:
            AU = 149.6e6 * 1000
            G = 6.67428e-11
            SCALE = 100 / AU  # 1AU = 125 pixels
            TIMESTEP = 3600 * 24  # 1 dia

            def __init__(self, x, y, radius, color, mass):
                self.x = x
                self.y = y
                self.radius = radius
                self.color = color
                self.mass = mass

                self.orbit = []
                self.sun = False
                self.distance_to_sun = 0

                self.x_vel = 0
                self.y_vel = 0

            def draw(self, win):
                x = self.x * self.SCALE + WIDTH / 2
                y = self.y * self.SCALE + HEIGHT / 2

                if len(self.orbit) > 2:
                    updated_points = []
                    for point in self.orbit:
                        x, y = point
                        x = x * self.SCALE + WIDTH / 2
                        y = y * self.SCALE + HEIGHT / 2
                        updated_points.append((x, y))

                    pygame.draw.lines(win, self.color, False, updated_points, 2)

                pygame.draw.circle(win, self.color, (x, y), self.radius)

                if not self.sun:
                    distance_text = FONT.render(f"{round(self.distance_to_sun / 1000, 1)}km", 1, WHITE)
                    win.blit(distance_text, (x - distance_text.get_width() / 2, y - distance_text.get_height() / 2))

            def attraction(self, other):
                other_x, other_y = other.x, other.y
                distance_x = other_x - self.x
                distance_y = other_y - self.y
                distance = math.sqrt(distance_x ** 2 + distance_y ** 2)

                if other.sun:
                    self.distance_to_sun = distance

                force = self.G * self.mass * other.mass / distance ** 2
                theta = math.atan2(distance_y, distance_x)
                force_x = math.cos(theta) * force
                force_y = math.sin(theta) * force
                return force_x, force_y

            def update_position(self, planets):
                total_fx = total_fy = 0
                for planet in planets:
                    if self == planet:
                        continue

                    fx, fy = self.attraction(planet)
                    total_fx += fx
                    total_fy += fy

                self.x_vel += total_fx / self.mass * self.TIMESTEP
                self.y_vel += total_fy / self.mass * self.TIMESTEP

                self.x += self.x_vel * self.TIMESTEP
                self.y += self.y_vel * self.TIMESTEP
                self.orbit.append((self.x, self.y))

        def text_objects(text, font, color):
            textSurface = font.render(text, True, color)
            return textSurface, textSurface.get_rect()

        # Mensagem, coordenadax,coordenaday, width, height, inactive_color, active_color, tamanho da fonte, cor, funo acionada ao clicar
        def button(msg, x, y, w, h, ic, ac, fontsize, color=(0, 0, 0), action=None):
            mouse = pygame.mouse.get_pos()
            click = pygame.mouse.get_pressed()
            if x + w > mouse[0] > x and y + h > mouse[1] > y:
                pygame.draw.rect(WIN, ac, (x, y, w, h))
                if click[0] == 1 and action != None:
                    action()
            else:
                pygame.draw.rect(WIN, ic, (x, y, w, h))

            smallText = pygame.font.Font('freesansbold.ttf', fontsize)
            TextSurf, TextRect = text_objects(msg, smallText, color)
            TextRect.center = (x + (w / 2), (y + (h / 2)))
            WIN.blit(TextSurf, TextRect)

        def info_loop():
            global info
            info = True
            while info:
                for event in pygame.event.get():
                    if event.type == pygame.QUIT:
                        pygame.quit()
                WIN.fill((0, 0, 0))

                # Faz aparecer na tela o conteudo de informacoes. (Esse conteudo  definido quando se clica em um planeta)
                if informacoes != []:
                    titulo = pygame.font.Font('freesansbold.ttf', 55)
                    TextSurf, TextRect = text_objects(informacoes[0], titulo, (255, 255, 255))
                    TextRect.center = (((largura - 100) / 2), (altura - 200) * 0.1)
                    WIN.blit(TextSurf, TextRect)
                    for i in range(1, len(informacoes)):
                        texto = pygame.font.Font('freesansbold.ttf', 20)
                        TextSurf, TextRect = text_objects(informacoes[i], texto, (255, 255, 255))
                        # TextRect.center = (((largura - 100) * 0.3), (altura - 200) * (0.2 * i))
                        WIN.blit(TextSurf, ((largura - 100) * 0.1, altura * 0.1 + 100 * i / 2))

                button("Voltar", (largura - 200) * 0.05, (altura - 100) * 0.95, 60, 40, (200, 200, 200),
                       (255, 255, 255), 20, action=out_loop)
                pygame.display.update()

        def out_loop():
            global info
            info = False

        def main():
            run = True
            clock = pygame.time.Clock()

            sun = Planet(0, 0, 25, YELLOW, 1.98892 * 10 ** 30)
            sun.sun = True

            earth = Planet(-1 * Planet.AU, 0, 16, BLUE, 5.9742 * 10 ** 24)
            earth.y_vel = 29.783 * 1000

            mars = Planet(-1.524 * Planet.AU, 0, 12, RED, 6.39 * 10 ** 23)
            mars.y_vel = 24.077 * 1000

            mercury = Planet(0.387 * Planet.AU, 0, 8, STRAW, 3.30 * 10 ** 23)
            mercury.y_vel = -47.4 * 1000

            venus = Planet(0.723 * Planet.AU, 0, 14, COOPER, 4.8685 * 10 ** 24)
            venus.y_vel = -35.02 * 1000

            jupiter = Planet(1.87 * Planet.AU, 0, 20, BRICK, 4.8685 * 10 ** 24)
            jupiter.y_vel = -21.83 * 1000

            saturn = Planet(-2.40 * Planet.AU, 0, 18, GOLDENROD, 5 * 10 ** 26)
            saturn.y_vel = 19.3 * 1000

            uranus = Planet(3.40 * Planet.AU, 0, 16, ICE, 8.6810 * 10 ** 25)
            uranus.y_vel = -16 * 1000

            neptune = Planet(4.5 * Planet.AU, 0, 15,SLATEBLUE, 1.0243 * 10 ** 26)
            neptune.y_vel = -14 * 1000

            try:

                planeta_novo = Planet((float(dist_sol_usuario) * 1000 /Planet.AU) * Planet.AU, 0, 12, PURPLE, float(massa_planeta_usuario))
                planeta_novo.y_vel = float(vel_planeta_usuario) * 1000
            except:
                pass

            planets = []

            if planeta_clicado == []:
                planets = [sun, mercury, earth, mars, venus, jupiter, saturn, uranus, neptune]
            elif planeta_clicado == ['venus']:
                planets = [sun, venus]
            elif planeta_clicado == ['marte']:
                planets = [sun, mars]
            elif planeta_clicado == ['urano']:
                planets = [sun, uranus]
            elif planeta_clicado == ['mercurio']:
                planets = [sun, mercury]
            elif planeta_clicado == ['saturno']:
                planets = [sun, saturn]
            elif planeta_clicado == ['jupiter']:
                planets = [sun, jupiter]
            elif planeta_clicado == ['netuno']:
                planets = [sun, neptune]
            elif planeta_clicado == ['terra']:
                planets = [sun, earth]
            elif planeta_clicado == ['usuario']:
                planets = [sun, planeta_novo]


            while run:
                clock.tick(60)
                WIN.fill((0, 0, 0))

                for event in pygame.event.get():
                    if event.type == pygame.QUIT:
                        run = False

                for planet in planets:
                    planet.update_position(planets)
                    planet.draw(WIN)

                button("INFO", (largura - 200) * 0.95, (altura - 100) * 0.95, 60, 40, (200, 200, 200), (255, 255, 255),
                       20, action=info_loop)

                pygame.display.update()

            pygame.quit()

        main()


